// CustomModal.js
import React, { useState } from 'react';
import Modal from 'react-modal';
export const addPayment = (orderId, paymentRising, cardId) => {
    fetch('http://localhost:5001/orders/newOrder', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        orderId, 
        paymentRising, cardId
      }),
    })
      .then((response) => response.json())
      
      .catch((error) => {
        console.error('Error creating the order:', error);
      });
  };
Modal.setAppElement('#root');

function CustomModal({ isOpen, onRequestClose, onPaymentSubmit }) {
  const [paymentRising, setPaymentRising] = useState('');
  const [cardId, setCardId] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    onPaymentSubmit(paymentRising, cardId);
  };

  return (
    <Modal isOpen={isOpen} onRequestClose={onRequestClose} contentLabel="Custom Modal">
      <h2>Add Payment</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Payment Rising:</label>
          <input type="text" value={paymentRising} onChange={(e) => setPaymentRising(e.target.value)} />
        </div>
        <div>
          <label>Card ID:</label>
          <input type="text" value={cardId} onChange={(e) => setCardId(e.target.value)} />
        </div>
        <button type="submit">Submit Payment</button>
      </form>
    </Modal>
  );
}

export default CustomModal;
